import React from "react";
import jumboData from "./fixtures/jumbo.json"
import Jumbotron from "./components/jumbotron/index"

export default function App() {
  return (
 <Jumbotron.Container>
{jumboData.map((el)=>{
  <Jumbotron key={el.id} direction = {el.direction}>
    <p>Hello</p>
  </Jumbotron>
})}
 </Jumbotron.Container>
  );
}
